import React from 'react'
import LogIn from './Nav'
function Login(props){
        const a={props};
        return (
            <div id='loginbox' style={a===1?{display:'block'}:{display:'none'}}>
                <input type='text' placeholder='Username' className='inputlogin' />
                <input type='Password' placeholder='Password' className='inputlogin' />
                <button>Submit</button>
            </div>
        )
    }
export default Login
